// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import HomePage from './components/HomePage';
import Interviews from './components/Dashboard/Interviews';
import NewInterview from './components/Dashboard/NewInterview';
import DataVisualization from './components/Dashboard/DataVisualization';
import './App.css';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={HomePage} />
        <Route path="/dashboard/interviews" component={Interviews} />
        <Route path="/dashboard/new-interview" component={NewInterview} />
        <Route path="/dashboard/data-visualization" component={DataVisualization} />
      </Switch>
    </Router>
  );
}

export default App;






